@EU_Commission 
@Europarl_EN 
@EUCouncil 
What else Catalan citizens have to do to force political dialogue, negotiation and agreenent between Spanish and Catalan institutions for a democratic solution to the current political crisis?

@EU_Commission @donaldtusk @JunckerEU Sir, you've served well during a very challenging period in #Europe.
However, with the rise in #populism, &amp; polarization of #EUCitizens, it appears that we've put the #refugeecrisis "under the carpet", &amp; abandoned #refugees &amp; #EUCitizens on #AgeanIslands?

Pls help us solve this.
